import { jsPDF } from "jspdf";
var font =
    "";
var callAddFont = function () {
    this.addFileToVFS("Lumanosimo-Regular-normal.ttf", font);
    this.addFont("Lumanosimo-Regular-normal.ttf", "Lumanosimo", "normal");
    this.addFont("Lumanosimo-Regular-normal.ttf", "Lumanosimo", "italic");
    this.addFont("Lumanosimo-Regular-normal.ttf", "Lumanosimo", "bolditalic");
    this.addFont("Lumanosimo-Regular-normal.ttf", "Lumanosimo", "bold");
};
jsPDF.API.events.push(["addFonts", callAddFont]);
